import React from 'react';
import ReactDOM from 'react-dom';
import './pages/customer_layout/scss/style.scss';
import App from './App';
import * as serviceWorker from './serviceWorker';

ReactDOM.render(
  <div className="wrapper">
  		<App />
  </div>,
  document.getElementById('root')
);
ReactDOM.render(
  <>
  	<script src="%PUBLIC_URL%/template_frontend/js/jquery-3.3.1.min.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/jquery-ui.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/popper.min.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/bootstrap.min.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/owl.carousel.min.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/jquery.magnific-popup.min.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/aos.js"></script>
    <script src="%PUBLIC_URL%/template_frontend/js/main.js"></script>
  </>,
  document.getElementById('test')
);


// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
